#! /bin/python3
def minion_game(s):
    v=list("AEUIO")

    vowels=0
    consonants=0

    for i,l in enumerate(s):
        if l in v :
            vowels+=len(s)-i
        else:
            consonants+=len(s)-i
    ke=vowels
    st=consonants
    if ke>st:
        print("Kevin {}".format(ke))
    elif st>ke:
        print("Stuart {}".format(st))
    else:
        print("Draw")



if __name__ == '__main__':
    # s = input()
    s=""
    minion_game(s)

